import React from "react";
import Navbar from "../components/Navbar";
import FlightSearch from "../components/FlightSearch";

const FlightsPage = () => {
  const handleSearch = (params: any) => {
    console.log("Căutare inițiată:", params);
  };

  return (
    <div
      className="min-h-screen bg-gradient-to-br from-indigo-200 via-purple-100 to-pink-100
        flex flex-col"
      style={{
        fontFamily: "'Poppins', sans-serif",
      }}
    >
      <Navbar />
      <main className="flex-grow flex flex-col items-center justify-center px-6 py-20">
        <div
          className="w-full max-w-6xl bg-white/30 backdrop-blur-md rounded-3xl
            p-12 shadow-2xl border border-white/40 hover:shadow-3xl transition-shadow duration-500"
        >
          <h2
            className="text-5xl font-extrabold text-transparent bg-clip-text
              bg-gradient-to-r from-purple-600 via-indigo-700 to-pink-600 mb-10 text-center
              drop-shadow-md"
          >
            Caută un zbor
          </h2>
          <FlightSearch onSearch={handleSearch} />
        </div>
      </main>
    </div>
  );
};

export default FlightsPage;
